import {
  FaFacebookF,
  FaTwitter,
  FaLinkedinIn,
  FaInstagram,
} from "react-icons/fa";

const Footer = () => {
  return (
    <div className="flex justify-between items-centerv px-24 py-10 text-sm bg-green-100">
      <div>
        <p>2023 by Nitin Tundwal</p>
        <p>
          Powerd and secured by <span>Netlify</span>{" "}
        </p>
      </div>
      <div className="flex gap-6 text-center font-bold ">
        <div>
          <h1>Call</h1>
          <p>9310289535</p>
        </div>
        <div className="">
          <h1>Gmail</h1>
          <p>nitintundwal07@gmail.com</p>
        </div>
        <div>
          <p>Follow</p>
          <div></div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
